import React from 'react';

import * as G from './styled';

export default function GrowthItem1() {
    return (
        <>
            <G.ContainerArticles>
                <G.ArticleOne>
                    <G.ArticleTitle>
                        <h3>$ 100</h3>
                        <h4>100 + hours</h4>
                    </G.ArticleTitle>
                    <G.ArticleContent>
                        <p>
                            Lorem ipsum dolor sit amet, consectetur adipiscing
                            elit.
                        </p>
                    </G.ArticleContent>
                </G.ArticleOne>
            </G.ContainerArticles>
        </>
    );
}
